import React from 'react'
import 'react-dates/initialize';
import { DateRangePicker, SingleDatePicker, DayPickerRangeController } from 'react-dates';
import 'react-dates/lib/css/_datepicker.css';

class Splash extends React.Component{

  render () {
    return (
      <div>
          <form className="form" method="POST" action="#">
              <div className="input-group input--large">
                  <label className="label">Gear</label>
                  <input className="input--style-1" type="text" placeholder="What are you looking for" name="gear"/>
              </div>
              <div className="input-group input--medium">
                  <label className="label">Start Date</label>
                  <input className="input--style-1" type="text" name="Start Date" placeholder="mm/dd/yyyy" id="input-start"/>
              </div>
              <div className="input-group input--medium">
                  <label className="label">Return Date</label>
                  <input className="input--style-1" type="text" name="Return Date" placeholder="mm/dd/yyyy" id="input-end"/>
              </div>
              <button className="btn-submit" type="submit">search</button>
          </form>
      </div>
    )
  }
}


export default Splash
